  //       <a href="/login">Login</a>
  //       <button onClick={logout}>Logout</button>
  //     </div>
  //   );
  // }
}

root.render(
  <React.StrictMode>
    <Header />
    <RouterProvider router={reactRouter} /> {/* <Calculator/>, <Result /> */}
